function base64DecodeToIntArray(base64Str) {
    const base64Chars = 'ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789+/=';
    const base64Lookup = new Uint8Array(256);

    for (let i = 0; i < base64Chars.length; i++) {
        base64Lookup[base64Chars.charCodeAt(i)] = i;
    }

    const bytes = [];

    for (let i = 0; i < base64Str.length; ) {
        let b1 = base64Lookup[base64Str.charCodeAt(i++)];
        let b2 = base64Lookup[base64Str.charCodeAt(i++)];
        let b3 = base64Lookup[base64Str.charCodeAt(i++)];
        let b4 = base64Lookup[base64Str.charCodeAt(i++)];

        const byte1 = (b1 << 2) | (b2 >> 4);
        const byte2 = ((b2 & 15) << 4) | (b3 >> 2);
        const byte3 = ((b3 & 3) << 6) | b4;

        if (b3 !== 64) {
            bytes.push(byte1);
        }
        if (b4 !== 64) {
            bytes.push(byte2);
        }
        bytes.push(byte3);
    }

    return bytes;
}

function addSga(oz, sga) {
    oz.sendToActionScript("print.externalmoduleEx", "oz.viewer.print.OZAppletPrintBarcode_SGA_Voiceye");

    // SGA 설정 시작
    var extParam = "";
    var delimiter = "#oz#";
    let mode = "";
    if (sga == "1" || sga == "Y") {
        mode = "All";
    } else if (sga == "2") {
        mode = "2dbarcode";
    } else if (sga == "3") {
        mode = "vbarcode";
    }
    extParam += "ExternalMode=" + mode + delimiter // 모두 : all  || 2dbarcode : 2D 바코드만 || vbarcode : 음성 바코드만

    extParam += "VTitle=klid" + delimiter
    extParam += "VPosX=5" + delimiter
    extParam += "VPosY=5" + delimiter
    //extParam += "VPages=1^3^5" + delimiter

    extParam += "2D_OriginType=opz" + delimiter
    extParam += "2D_Width=170" + delimiter
    extParam += "2D_Wonbon=true" + delimiter

    // 2D 바코드 X,Y 좌표 설정 시 사용
    extParam += "2D_Scale=19" + delimiter
    extParam += "2D_PosX=125" + delimiter
    extParam += "2D_PosY=750" + delimiter

    //복사방지마크(원본) X, Y 좌표 설정 시 사용
    extParam += "2D_WonbonScale=33" + delimiter
    extParam += "2D_WonbonPosX=25" + delimiter
    extParam += "2D_WonbonPosY=750" + delimiter
    extParam += "2D_WonbonPath=/MCLOUD/app/oz/sga/tc_common/img/copy_protect.bmp" + delimiter

    extParam += "2D_PropertiesFilePath=%OZCONF%/oz_sga.properties"; // /MCLOUD/app/oz80/WEB-INF/conf/oz_sga.properties
    // SGA 설정 끝

    oz.sendToActionScript("connection.extraparam", extParam);
}

